// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="bg-gray-800 px-6 py-4 flex justify-between items-center shadow">
    <h1 className="text-teal-400 text-xl font-bold">HahuTech</h1>
    <div className="space-x-4">
      <Link to="/" className="text-white hover:text-teal-300">Home</Link>
      <Link to="/about" className="text-white hover:text-teal-300">About</Link>
      <Link to="/services" className="text-white hover:text-teal-300">Services</Link>
      <Link to="/contact" className="text-white hover:text-teal-300">Contact</Link>
    </div>
  </nav>
);

export default Navbar;
